            215 =>
            array (
                'active' => 1,
                'created_at' => '2021-05-24 16:37:15',
                'id' => 367,
                'problem_description' => 'WHY SUDDENLY HAVE FUNNY CHARACTER PRINTED OUT',
                'problem_solution' => '<p>1. This is mostly happen at the Dot-Matrix Printer.</p>

<p>2. This is because of the Printer cable not connected properly.</p>

<p>3. You need to switch off the printer , unplug the printer cable for both end computer and printer then plug back.</p>

<p>4. Lastly switch on back the printer, it should be OK now.</p>',
                'solutioncode' => 'SP00000011',
                'updated_at' => '2021-05-24 16:37:15',
            ),
            216 =>
            array (
                'active' => 1,
                'created_at' => '2021-05-24 16:46:15',
                'id' => 368,
                'problem_description' => 'HOW TO DO BACKUP',
                'problem_solution' => '<p>1. Just goto UTILITIES, click -&gt;Backup Data Files.</p>

<p>2. Then Click -&gt; Update, it will start the process of backup for the system, it may take different time for different specification of computer. at the final, it should prompt out a box to inform you to save the files to where ?</p>

<p>3. Normally, you need to insert the Pendrive externally for backup the data daily. Just select where you want to save as normal save file method will do. Bear in mind that there are 2 files need to save to your drive.</p>

<p>4. BACKUP daily will save you a lot effort in case of computer down.</p>

<p>&nbsp;</p>',
                'solutioncode' => 'SP00000012',
                'updated_at' => '2021-05-24 16:46:15',
            ),
            217 =>
            array (
                'active' => 1,
                'created_at' => '2021-05-24 16:53:45',
                'id' => 369,
                'problem_description' => 'WANT TO CORRECT MY PAWN ITEMS',
                'problem_solution' => '<p>Normally this happen because of key in wrongly for the pawn items and printed out.</p>

<p>1. Just goto -&gt; EDIT TICKET on the spot or at the same day then allow to solve this.</p>

<p>2. Inside here, just put the &lt;Pawn Ticket Number&gt;, the information of the ticket that you want to change will be display here.</p>

<p>3. Just goto which pawn item that wrong or dont want, click -&gt; &lt;X&gt; for remove the item, then follow by key in the new item or correct item you want and add back. Finally, press &lt;F2&gt; or click -&gt; SAVE / UPDATE to update and print out the correct copy of the ticket.</p>',
                'solutioncode' => 'SP00000013',
                'updated_at' => '2021-05-24 16:53:45',
            ),
            218 =>
            array (
                'active' => 1,
                'created_at' => '2021-05-24 16:58:15',
                'id' => 370,
                'problem_description' => 'PAPER JAM WHILE PRINT PAWN TICKET',
                'problem_solution' => '<p>1. Switch Off the printer.</p>

<p>2. Take out the jamed paper.</p>

<p>3. Switch on back the printer.</p>

<p>4. Goto EDIT TICKET and click it, put in the Ticket Number and press &lt;ENTER&gt;, all related information shown, just click -&gt; UPDATE and the ticket will print out again. Just check if nothing wrong then is ok.</p>',
                'solutioncode' => 'SP00000014',
                'updated_at' => '2021-05-24 16:58:15',
            ),
            219 =>
            array (
                'active' => 1,
                'created_at' => '2021-05-24 17:04:33',
                'id' => 371,
                'problem_description' => 'FORGOT TO REDEEM PREVIOUS MONTH PAWN TICKET',
                'problem_solution' => '<p>1. Goto UTILITIES then click it, select BACK DATE REDEEM TICKET and click it.</p>

<p>2. Put in the missing Pawn Ticket Number here and press &lt;ENTER&gt;.</p>

<p>3. use mouse or keyboard to press Up to Redeem Date, just fill in the correct redeem date and make sure the rest are correct and click or press &lt;OK&gt; to Save.</p>',
                'solutioncode' => 'SP00000015',
                'updated_at' => '2021-05-24 17:04:33',
            ),
