                'problem_description' => '<p>Asking solution for solving their situation: A customer done payment after they closed month end yesterday and ask the way to change back last month date and submit the payment.</p>',
                'problem_solution' => '<p>Provided 2 suggestion as below:</p>

<p>1. Since they already create new runing number after closed month end. They can edit with last month interest amount when submit payment.</p>

