<p>&nbsp;&nbsp;&nbsp; a. Go to utilities &gt; reset back previous month , set back last month.</p>

<p>&nbsp;&nbsp;&nbsp; b. Go to System information (A) general conditions set the runing number to last month latest running number (for this one after change they need to stop doing new transaction first)</p>

