<p>&nbsp;&nbsp;&nbsp; d. Do the repawn and print all the requirement report.</p>

<p>&nbsp;&nbsp;&nbsp; e. After that logout and login with current date then go set back the month to current month from reset back previous month. After that set running number to current latest running number at system information then they can continue their&nbsp; transaction.</p>

